import React, {Component} from 'react';
import './Homepage.css';
import './css/main.css';
import './css/util.css';

function Homepage(props) {

    function logout(){
    	props.backhome();
    }

    return (
        <div >
            <h1>Welcome {props.userData.idenity}.</h1>
            <div className="container-login100-form-btn m-t-17">
                <button onClick={logout} className="login100-form-btn">
                    Logout!
                </button>
            </div>
        </div>
    )
}
export default Homepage;
